/*
给你一个非负整数数组 nums ，你最初位于数组的第一个位置。

数组中的每个元素代表你在该位置可以跳跃的最大长度。

你的目标是使用最少的跳跃次数到达数组的最后一个位置。

假设你总是可以到达数组的最后一个位置。

思考: 若当前位置对应的数组为3，则可以选择跳1步、2步或者3步，从这三种情况中选择最大的数，则说明跳跃的步数最少。
f（0） = min(f(1) + 1,f(2) +1,f(3)+1 )

*/
func jump(nums []int) int {
	saverJump = make([]int, 10000)
	return jumpChooice(0, nums)
}

func jumpChooice(index int, nums []int) int {
	if index >= len(nums)-1 {
		return 0
	}
	num := nums[index]
	if num == 0 {
		num = 1
	}
	if num >= len(nums)-index {
		return 1
	}
	min := 1000000
	for i := 1; i <= num; i++ {
		value := saverJump[index+i]
		if value == 0 {
			value = jumpChooice(index+i, nums) + 1
			saverJump[index+i] = value
		}
		if value < min {
			min = value
		}
	}
	return min
}

var saverJump []int
